import React from 'react';

import './User.css';

const User = props => {
    // const [deleteText, setDeleteText] = useState('');

    const deleteHandler = () => {
        // setDeleteText('(Deleted!)');
        props.onDelete(props.id);
    };

    return (
        <li className="goal-item" onClick={deleteHandler}>
            {props.children}
        </li>
    );
};

export default User;
